eval("(function() {\n\n// Kick off Ember\nCCAdmin = Ember.Application.create({\n    rootElement: '#application',\n});\n\nFixtures = Ember.Object.create({\n    letters: 'ABCDEFGHIJKLMNOPQRSTUVWXYZ'.split(''),\n    searchLimit: 15\n});\n\n// Components\nCCAdmin.Select2Component = Ember.TextField.extend({\n    attributeBindings: ['objectQuery'],\n    didInsertElement: function() {\n        var items = this.get('value');\n        var objectQuery = this.get('objectQuery');\n        var options = {\n            width: 'element',\n            tags: [],\n            tokenSeparators: [',']\n        };\n\n        if (!Ember.isNone(objectQuery)) {\n            options.query = function(query) {\n                dpd(objectQuery).get({name: {$regex:  '(?i)' + query.term + '\\w*'}}, function(result, error) {\n                    if (!Ember.isEmpty(result)) {\n                        query.callback({ results : result.map(function(item) { return { id: item.id, text: item.name }}) });\n\n                    }\n\n                    if (!Ember.isNone(error)) {\n                        console.log(error);\n                    }\n                });\n            };\n\n            options.initSelection = function(e, callback) {\n                callback(items.map(function(item) { return { id: item.id, text: item.name}}));\n            };\n        } else {\n            options.dropdownCss = { display: 'none' };\n        }\n\n        this.$().select2(options);\n    }\n});\n\n// Views\nCCAdmin.MainView = Ember.View.extend({\n    click: function() {\n        this.get('controller').send('clearEdits');\n    }\n});\n\n// Controllers\nCCAdmin.MainController = Ember.ObjectController.extend({\n\n});\n\nCCAdmin.LetterController = Ember.ObjectController.extend({\n    isFilter: function() { \n        return this.get('parentController').get('letterFilter') === this.get('content');\n    }.property('parentController.letterFilter')\n});\n\n})();//@ sourceURL=adminApp/ccAdminApp.js")

eval("(function() {\n\nCCAdmin.SongsController = Ember.ArrayController.extend({\n\n});\n\nCCAdmin.SongController = Ember.ObjectController.extend({\n    artistsDisplayText: function() {\n        return this.get('artists').getEach('name');\n    }.property('artists'),\n    actions: {\n        clickEdit: function() {\n            if (this.get('isNew') !== true) {\n                this.send('clearEdits');\n                this.setProperties({\n                    isEdit: true,\n                    displayTextEdit: this.get('displayText'),\n                    artistsEdit: this.get('artists'),\n                    titleEdit: this.get('title'),\n                    tagsEdit: !Ember.isNone(this.get('tags')) ? this.get('tags').join(',') : []\n                });\n            }\n        },\n        clickDone: function() {\n            var displayTextEdit = this.get('displayTextEdit');\n            var artistsEdit = this.get('artistsEdit');\n            var titleEdit = this.get('titleEdit');\n            var tagsEdit = this.get('tagsEdit');\n\n            this.set('displayTextError', Ember.isEmpty(displayTextEdit));\n            this.set('artistsError', Ember.isEmpty(artistsEdit));\n            this.set('titleError', Ember.isEmpty(titleEdit));\n\n            if (!Ember.isEmpty(displayTextEdit) && !Ember.isEmpty(artistsEdit) && !Ember.isEmpty(titleEdit)) {\n                var self = this;\n\n                this.setProperties({\n                    isEdit: undefined,\n                    isNew: undefined,\n                    displayTextError: undefined,\n                    artistsError: undefined,\n                    titleError: undefined,\n                });\n\n                if (!Ember.isNone(this.get('id'))) {\n                    dpd.songs.put({\n                        id: this.get('id'),\n                        displayText: displayTextEdit,\n                        artists: artistsEdit.split(','),\n                        title: titleEdit,\n                        tags: !Ember.isEmpty(tagsEdit) ? tagsEdit.split(',') : []\n                    }, function(result, error) {\n                        if (!Ember.isNone(result)) {\n                            self.setProperties({\n                                id: result.id,\n                                displayText: result.displayText,\n                                title: result.title,\n                                tags: result.tags\n                            });\n                        }\n                    });\n                } else {\n                    dpd.songs.post({\n                        displayText: displayTextEdit,\n                        artists: artistsEdit,\n                        title: titleEdit,\n                        tags: !Ember.isEmpty(tagsEdit) ? tagsEdit.split(',') : []\n                    }, function(result, error) {\n                        if (!Ember.isNone(result)) {\n                            self.setProperties({\n                                id: result.id,\n                                displayText: result.displayText,\n                                title: result.title,\n                                tags: result.tags\n                            });\n                        }\n                    });\n                }\n            }\n        }\n    }\n});\n\n})();//@ sourceURL=adminApp/ccAdminSong.js")

eval("(function() {\n\nCCAdmin.ArtistsController = Ember.ArrayController.extend({\n    isNextDisabled: function() {\n        return this.get('hasNext') === false;\n    }.property('hasNext'),\n    isPrevDisabled: function() {\n        console.log(this.get('skipValue'));\n        return Ember.isNone(this.get('skipValue')) || this.get('skipValue') <= 0;\n    }.property('skipValue'),\n    hasNew: function() {\n        return this.anyBy('isNew', true);\n    }.property('[]'),\n    actions: {\n        clickAdd: function() {\n            this.send('clearEdits');\n            this.addObject({\n                name: '',\n                tags: [],\n                isEdit: true,\n                isNew: true\n            });\n        },\n        clickFilterByLetter: function(letter) {\n            this.get('letterFilter') === letter.valueOf() ? \n                            this.set('letterFilter', undefined) : this.set('letterFilter', letter.valueOf());\n            this.send('getArtists');\n        },\n        clickClearFilter: function() {\n            this.set('letterFilter', undefined);\n            this.send('getArtists');\n        },\n        clickNextPage: function() {\n            if (!this.get('isNextDisabled')) {\n                var newSkipValue = this.getWithDefault('skipValue', 0) + Fixtures.get('searchLimit');\n                this.set('skipValue', newSkipValue);\n                this.send('getArtists');\n            }\n        },\n        clickPrevPage: function() {\n            if (!this.get('isPrevDisabled')) {\n                var newSkipValue = this.getWithDefault('skipValue', 0) - Fixtures.get('searchLimit');\n                if (newSkipValue < 0) { newSkipValue = 0; }\n                this.set('skipValue', newSkipValue);\n                this.send('getArtists');\n            }\n        },\n        getArtists: function() {\n            var searchLimit = Fixtures.get('searchLimit');\n            var self = this;\n            var query = {\n                $sort: { name : 1},\n                $limit: searchLimit + 1\n            };\n\n            if (!Ember.isNone(this.get('letterFilter'))) {\n                query.name = { $regex : '[' + this.get('letterFilter') + ']'}\n            }\n\n            if (!Ember.isNone(this.get('skipValue'))) {\n                query['$skip'] = this.get('skipValue');\n            }\n\n            dpd.artists.get(query, function(result, error) {\n                if (!Ember.isNone(result)) {\n                    result.length === searchLimit + 1 ? self.set('hasNext', true) : self.set('hasNext', false);\n                    self.set('content', result.slice(0, searchLimit));\n                } else if (!Ember.isNone(error)) {\n                    console.log(error)\n                }\n            });\n        }\n    }\n});\n\nCCAdmin.ArtistController = Ember.ObjectController.extend({\n    actions: {\n        clickEdit: function() {\n            if (this.get('isNew') !== true) { // To prevent weirdness when clicking on a new artist's row.\n                this.send('clearEdits');\n                this.setProperties({\n                    isEdit: true,\n                    nameEdit: this.get('name'),\n                    tagsEdit: !Ember.isNone(this.get('tags')) ? this.get('tags') : []\n                });\n            }\n        },\n        clickDone: function(addAnother) {\n            if (Ember.isEmpty(this.get('nameEdit'))) {\n                this.set('has-error', true);\n            } else {\n                var self = this;\n                this.setProperties({\n                    nameError: undefined,\n                    isEdit: undefined,\n                    isNew: undefined,\n                });\n\n                if (!Ember.isNone(this.get('id'))) {\n                    dpd.artists.put({\n                        id: this.get('id'),\n                        name: this.get('nameEdit'),\n                        tags: !Ember.isEmpty(this.get('tagsEdit')) ? this.get('tagsEdit').split(',') : []\n                    }, function(result, error) {\n                        if (!Ember.isNone(result)) {\n                            self.setProperties(result);\n                        }\n                    });\n                } else {\n                    dpd.artists.post({\n                        name: this.get('nameEdit'),\n                        tags: !Ember.isEmpty(this.get('tagsEdit')) ? this.get('tagsEdit').split(',') : []\n                    }, function(result, error) {\n                        if (!Ember.isNone(result)) {\n                            self.setProperties(result);\n                        }\n                    });\n                }\n\n                if (addAnother === \"true\") {\n                    this.send('clickAdd');\n                }\n            }\n        },\n        clickDelete: function(obj) {\n            var parentController = this.get('parentController');\n            dpd.artists.del(this.get('id'), function(result, error) {\n                if (!Ember.isNone(result)) {\n                    \n                    parentController.removeObject(obj);\n                    console.log(parentController)\n                    if (parentController.get('content').length === 0) {\n                        if (parentController.get('isNextDisabled') === false) {\n                            parentController.set('skipValue', parentController.getWithDefault('skipValue', 0) - Fixtures.get('searchLimit'));\n                            parentController.send('clickNextPage');\n                        } else if (parentController.get('isPrevDisabled') === false) {\n                            parentController.send('clickPrevPage');\n                        }\n                    }\n                }\n            });\n        }\n    }\n});\n\n})();//@ sourceURL=adminApp/ccAdminArtist.js")

